import React from 'react';
import { ILegendProps } from '../types/types';
import SvgRect from './SVGRectangle';
import { selectedColor } from '../utils/MapStyles';

const Legend = (props: ILegendProps) => {
    const {
    } = props
    return (
        <>
            <SvgRect
                height='25'
                width='25'
                fillColor={selectedColor[0]}
                fillOpacity='0.5'
                strokeColor={selectedColor[1]}
                strokeOpacity='1'
                strokeWidth='5'
            />
            <SvgRect
                height='25'
                width='25'
                fillColor='#d20003'
                fillOpacity='0.5'
                strokeColor='#456aaa'
                strokeOpacity='1'
                strokeWidth='5'
            />
        </>
    )
}

export default Legend;
